import * as React from "react";
import './footer.css';

export default class footer extends React.Component {

    render() {
        return (
            <div id="footer">
                <div className="row">
                    <div className="col">
                        <p>&copy;{new Date().getFullYear} MarcusMathiesen ApS | Bragesgade 2, 4. tv, 2200 Copenhagen, Denmark | All Rights | <a href="#contact">Contact</a> </p>
                    </div>
                </div>
                <div className="row">

                </div>
            </div>
        );
    }
}
